INSERT INTO `Announcements` VALUES (1,'WT am 17.05.2022 findet statt','\nGuten Abend,\n\nmir wurde mitgeteilt, dass leider versehentlich der falsche Termin aus der Stundenplanung gelöscht wurde. Am 24.05.2022 werden die Präsenz-Termine wie letzte Woche angekündigt entfallen. Bitte entschuldigen Sie die Verwirrung.\n\nViele Grüße','2023-01-19 22:06:41','2023-01-19 22:06:41',53,73),(2,'Hybrid','Da eine zunehmende Anzahl von Teilnehmerinnen und Teilnehmern corona-bedingt in Quarantäne müssen, werde ich ab sofort die Veranstaltung in einem hybriden Format anbieten.','2023-01-19 22:08:35','2023-01-19 22:08:35',53,73);
